import React from 'react';
// import Logo from './assets/navimage.jpg'
const Nav = () => {
  return (
    <>
      <div className='container row mainNav'>
          <span className='logo'>Logo</span>

          <ul className='pages'>
            <li className='page'>Home</li>
          </ul>
      </div>
    </>
  )
}
export default Nav;
